import React from "react";
import ImageSvg from "./ImageSVG";

import "./component.css";

const Header = () => {
  return (
    <div className="headerComponent">
      <h1>Explorer Shop</h1>
      <div className="icons_box">

          <ImageSvg
            config={{
              icon: "User",
              fill: "white",
              stroke: "black",
              size: 30,
            }}
          />
      </div>
    </div>
  );
};

export default Header;
